import React, {useState, useEffect} from 'react';
import { Link } from 'react-router-dom';
import {Nav, Navbar, Tab, Row, Col, Form} from 'react-bootstrap'
import styled from 'styled-components';
import { motion} from "framer-motion";

//logo
import logo from '../assets/PneuS-03.png'

const Styles = styled.div`
display:grid;
grid-template: repeat(5, [row] 20vh) / repeat(4, [col] 1fr);

.nav-bar {
  grid-column: col 1 / span 4;
  grid-row: row 1;
  background: linear-gradient(to left, #6441a5, #2a0845);
}

.left-bar {
  grid-column: col 4;
  grid-row: row 1 / span 3;
  background: linear-gradient(to right, #ffb347, #ffcc33);
  opacity: 0.8;
}

.right-bar {
  grid-column: col 1;
  grid-row: row 2 / span 2;
  background: linear-gradient(to top, #d38312, #a83279);
  z-index: 1;
  opacity: 0.8;
}

.search-bar {
  grid-column: col 2 / span 2;
  grid-row: row 2;
  background: linear-gradient(to left, #b3ffab, #12fff7);
}

.item-5 {
  grid-column: col 1;
  grid-row: row 3;
  background: linear-gradient(to top, #485563, #29323c);
}

.item-6 {
  grid-column: col 2 / span 3;
  grid-row: row 3;
  background: linear-gradient(to right, #fe8c00, #f83600);
}


`;

function Header(props){
    return(
        <React.Fragment>
            <Styles>
                    <div className='nav-bar'> navbar </div>
                    <div className='left-bar'> left bar </div>
                    <div className='right-bar'> right bar </div>
                    <div className='search-bar'> search bar </div>
                    <div className='item-5'> item 5 </div>
                    <div className='item-6'> item 6  </div>

            </Styles>
        </React.Fragment>
    )
}
export default Header;
